import React from 'react'

const Fragment = ({propFragment}) => {
  return (
    <>
        <h2>Primeiro título</h2>
        <h3>Segundo título</h3>
        <h4>{propFragment.fragment}</h4>
    </>
  )
}

export default Fragment
